/**
 * Return a typed patch builder for a specific resource.
 */
export function fhirJSONPatch(
  resourceType?: null | undefined
): FhirJSONPatchBuilder;
export function fhirJSONPatch<
  TDomainResourceType extends AnyDomainResourceType = AnyDomainResourceType
>(resourceType: TDomainResourceType): ExtractPatchBuilder<TDomainResourceType>;
export function fhirJSONPatch<
  TDomainResourceType extends AnyDomainResourceType = AnyDomainResourceType
>(
  resourceType?: TDomainResourceType | null | undefined
): FhirJSONPatchBuilder | ExtractPatchBuilder<TDomainResourceType>;
export function fhirJSONPatch<
  TDomainResourceType extends AnyDomainResourceType = AnyDomainResourceType
>(
  resourceType?: TDomainResourceType | null | undefined
): FhirJSONPatchBuilder | ExtractPatchBuilder<TDomainResourceType> {
  if (!resourceType) {
    return new FhirJSONPatchBuilder();
  }

  return new FhirJSONPatchBuilder() as unknown as ExtractPatchBuilder<TDomainResourceType>;
}

